measurements.description:
Fifty-four flowers and four buds nicely shingled on four up to 96-cm inflorescences;
sepals and petals chartreuse, maroon veins, blushed maroon except margins and medially;
lip fimbriate, ciliate, cream, side lobes marked mahogany, midlobe marked crimson, keels ciliate, cream marked mahogany;
column inferior surface cream spotted mahogany, superior surface shading light to dark mahogany distally, anther cap cream;
 substance firm; texture matte.
